import './App.css';
import librarybg from './img/librarybg.png';

function Hero() {
  return (
      <header className="hero-box">
        <img src={librarybg} className="hero-box-logo" alt="logo" />
        <div className='hero-box-text'>
            Biblioprzygoda!
        </div>
        <div className='hero-box-shadow'></div>
      </header>
  );
}

export default Hero;
